import TextField from '@mui/material/TextField';
import InputAdornment from '@mui/material/InputAdornment';
import AccountCircle from '@mui/icons-material/AccountCircle';
import PhoneAndroidIcon from '@mui/icons-material/PhoneAndroid';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import AccountBalanceIcon from '@mui/icons-material/AccountBalance';
import CancelPresentationIcon from '@mui/icons-material/CancelPresentation';



export const NewAccount=()=>{
    return(
        <>
            <div className="container-fluid">
                <Typography className='text-center text-success' variant="h4" component="div" gutterBottom>
                    New Account Openning
                </Typography>
                <div className="row justify-content-center">
                    <div className="col-lg-8 col-md-10 col-sm-12 shadow p-4">
                        <TextField
                            id="input-with-icon-textfield"
                            label="Account Holder"
                            InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                <AccountCircle />
                                </InputAdornment>
                            ),
                            }}
                            variant="outlined"
                            className='form-control'
                        />
                        <div className='row mt-2'>
                            <div className='col-lg-6 col-sm-12'>
                                <TextField
                                    id="input-with-icon-textfield"
                                    label="Account Contact"
                                    InputProps={{
                                    startAdornment: (
                                        <InputAdornment position="start">
                                            <PhoneAndroidIcon/>
                                        </InputAdornment>
                                    ),
                                    }}
                                    variant="outlined"
                                    className='form-control'
                                />
                            </div>
                            <div className='col-lg-6 col-sm-12'>
                                <TextField
                                    id="input-with-icon-textfield"
                                    label="Account Email"
                                    InputProps={{
                                    startAdornment: (
                                        <InputAdornment position="start">
                                            <MailOutlineIcon/>
                                        </InputAdornment>
                                    ),
                                    }}
                                    variant="outlined"
                                    className='form-control'
                                />
                            </div>
                        </div>
                        <TextField
                            id="input-with-icon-textfield"
                            label="Account Openning balance"
                                InputProps={{
                                startAdornment: (
                                    <InputAdornment position="start">
                                        â‚¹
                                    </InputAdornment>
                                ),
                                }}
                            variant="outlined"
                            className='form-control mt-2'
                        />
                        <TextField
                            id="input-with-icon-textfield"
                            label="Customer Id"
                            variant="outlined"
                            className='form-control mt-2'
                        />
                        <div className='row mt-2'>
                            <div className='col-sm-12'>
                            <OutlinedInput
            id="outlined-adornment-password"
            type={values.showPassword ? 'text' : 'password'}
            value={values.password}
            onChange={handleChange('password')}
            endAdornment={
              <InputAdornment position="end">
                <IconButton
                  aria-label="toggle password visibility"
                  onClick={handleClickShowPassword}
                  onMouseDown={handleMouseDownPassword}
                  edge="end"
                >
                  {values.showPassword ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            }
            label="Password"
          />
                            </div>
                        </div>
                        <div className='row justify-content-around mt-2'>
                            <Button className='col-2' variant="outlined" color="primary">
                                <AccountBalanceIcon/>Open
                            </Button>
                            <Button className='col-2' variant="outlined" color="error">
                                <CancelPresentationIcon/>Cancel
                            </Button>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
